import {Link} from "react-router-dom";

export default function (){
    return(
        <>
            <nav>

                <Link to="/">Home</Link>
                <Link to="/members/new">register</Link>

                <Link to="/members">registered List</Link>

                <Link to="/items/new">product</Link>

                <Link to="/items">product List</Link>

                <Link to="/order">product order</Link>

                <Link to="/orders">order List</Link>

            </nav>


        </>
    )
}
